INSERT INTO `ost__search` VALUES ('H',1,'osTicket a été installé!','Merci d\'avoir choisi osTicket. Veuillez rejoidre les forums d\'osTicket et notre liste de diffusion afin de rester à jour sur les dernières nouvelles, les alertes de sécurité et les mises à jour. Les forums d\'osTicket sont également un excellent endroit pour obtenir aide, conseils, astuces ou pour aider d\'autres utilisateurs d\'osTicket. Outre les forums, le wiki d\'osTicket fournit une collection utile du matériel pédagogique, documentation et notes de la communauté. Nous accueillons vos contributions à la communauté d\'osTicket. Si vous êtes à la recherche d\'un meilleur niveau de support, nous fournissons des services professionnels et un support professionnel avec temps de réponse garantis et l\'accès à l\'équipe de développement de base. Nous pouvons également vous aider à personnaliser osTicket ou encore ajouter de nouvelles fonctionnalités au système pour répondre à vos besoins uniques. Si l\'idée de la gestion et de la mise à niveau de cette installation d\'osTicket est intimidante, vous pouvez essayer osTicket comme un service hébergé à http://www.supportsystem.com/ - aucune installation requise et nous pouvons importer vos données ! Avec l\'infrastructure clé en main de SupportSystem, vous obtenez le meilleur d\'osTicket, vous laissant libre de vous concentrer sur vos clients sans la charge de veiller à ce que l\'application soit stable, maintenue et sûre. Cordialement, - L\'équipe osTicket http://osticket.com/ PS. Il ne faut pas juste faire des clients heureux, faites d\'heureux clients !'),('H',2,'','osTicket est un système de ticket de support largement utilisé et open-source. C\'est une alternative intéressante aux systèmes de support plus coûteux et complexes - ses qualités : simple, léger, fiable, open-source, basé sur le web, facile à installer et à utiliser.'),('H',3,'Statut modifié','Statut modifié de Ouvert vers Fermé par Tristan Besson'),('H',4,'','Ceci est un test de ticketing'),('H',5,'','Bien recu ! Ceci est un test de ticketing'),('H',6,'Statut modifié','Statut modifié de Ouvert vers Fermé par Tristan Besson Ticket de test terminé'),('H',7,'','Au secours SOS'),('H',8,'Il soûle avec ses question','Il est un peu bête'),('H',9,'','C\'est corrigé !'),('H',10,'Statut modifié','Statut modifié de Ouvert vers Fermé par Tristan Besson'),('H',11,'','testt t'),('H',12,'','testt t'),('H',13,'Statut modifié','Statut modifié de Ouvert vers Fermé par Tristan Besson'),('H',14,'','bkalblablalbla'),('H',15,'','test2'),('H',16,'','Veuillez downgradé votre version de windows !'),('K',1,'Test question','testestestest'),('K',2,'Accéder au Webmail','Mots clés : Exchange - Outlook - Messagerie - Webmail'),('K',3,'Comment changer son mot de passe Exchange ?','Mots clés : Mot de passe - Exchange - Outlook - Messagerie'),('K',4,'Guide d\'utilisation du webmail','Vous trouverez ci-joint le guide d\'utilisation du webmail Exchange.'),('K',5,'Installer un copieur HP','Vous trouverez ci-joint la procédure pour installer un copieur HP.'),('K',6,'Installer un traceur HP','Vous trouverez ci-joint la procédure pour installer un copieur HP.'),('O',1,'osTicket','420 Desoto Street\nAlexandria, LA 71301\n(318) 290-3674\nhttp://osticket.com\nNon seulement nous développons le logiciel, nous l\'utilisons également pour gérer le support d\'osTicket. Laissez nous vous aider à rapidement mettre en place et tirer parti au maximum des fonctionnalités d\'osTicket. Contactez nous pour un accompagnement professionnel ou visitez notre site web pour accéder à la documentation et à l\'entraide communautaire.'),('T',1,'716347 osTicket a été installé!',''),('T',2,'491384 Test ticketing','Test ticketing'),('T',3,'331975 CA MARCHE PAS !','CA MARCHE PAS !'),('T',4,'627426 Test','Test'),('T',5,'410067 J\'ai windows 10 T_T','J\'ai windows 10 T_T'),('T',6,'575215 hohé test2','hohé test2'),('U',1,'Support osTicket','support@osticket.com'),('U',2,'Tristan BESSON',''),('U',3,'Sylvain JUBEAU',''),('U',4,'Arnaud POUZOLS','');
