INSERT INTO `ost_draft` VALUES (2,1,'page.1',' <h1>Bienvenue au centre de Support</h1> Afin de simplifier les demandes de support et de mieux vous servir, nous utilisons un système de gestion de ticket. A chaque demande de support est attribué un numéro de ticket unique vous permettant de suivre en ligne sa progression et les réponses apportées. Pour votre information, nous fournissons des archives et un historique complet de toutes vos demandes de support. Une adresse e-mail valide est nécessaire pour soumettre un ticket. <br /> ',NULL,'2015-12-01 09:06:38','2015-12-01 09:06:48'),(3,3,'ticket.client.ildfo7s86b92','',NULL,'2015-12-22 12:08:25',NULL),(4,3,'ticket.client.sb7a1ksrlgs0','',NULL,'2015-12-22 12:32:36',NULL),(5,2,'tpl.note.alert.1',' <h3><strong>Bonjour %{recipient.name},</strong></h3> Un agent à posté une note interne sur le ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> <br /><br /><table><tbody> <tr> <td> <strong>De</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Titre</strong>: </td> <td> %{note.title} </td> </tr> </tbody></table> <br /> %{note.message} <br /><br /><hr /> Pour voir/répondre au ticket, merci de vous <a href=\"%%7Bticket.staff_link%7D\">connecter</a> au support <br /><br /><em>L\'équipe du support</em> <br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ',NULL,'2015-12-22 12:53:06','2015-12-22 12:53:16'),(6,2,'tpl.message.alert.1',' <h3><strong>Bonjour %{recipient},</strong></h3> Nouveau message ajouté au ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> <br /><br /><table><tbody> <tr> <td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Département</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody></table> <br /> %{message} <br /><br /><hr /> <div>Pour visualiser ou répondre au ticket, merci de vous <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">connecter</span></a> au système de support par ticket</div> <em style=\"color:rgb(127, 127, 127)\">Votre Système de Support Client dévoué</em><br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"23\" style=\"width:126px\" /> ',NULL,'2015-12-22 12:53:12','2015-12-22 12:53:22'),(7,2,'ticket.response.2','Bonjour % {ticket.name.first}, <br /><br />Votre ticket #% {ticket.number} créé le % {ticket.create_date} est dans le département nommé \"% {ticket.dept.name}\".',NULL,'2015-12-22 12:54:16','2015-12-22 12:54:26'),(8,2,'ticket.note.2','',NULL,'2015-12-22 12:54:16','2015-12-22 12:54:26'),(9,2,'ticket.client.ih8a0soa0sh3','',NULL,'2015-12-22 13:05:15',NULL),(10,3,'ticket.client.7rj92cnvt003','',NULL,'2015-12-22 13:07:05',NULL),(11,3,'ticket.client.1b09tu8ltgi4','',NULL,'2015-12-22 13:08:14','2015-12-22 13:08:24'),(12,1,'ticket.response.1','',NULL,'2016-01-04 12:48:48','2016-01-04 12:48:58'),(13,1,'ticket.note.1','',NULL,'2016-01-04 12:48:48','2016-01-04 12:48:58'),(19,1,'ticket.response.3','',NULL,'2016-01-04 15:04:48','2016-01-04 15:04:57'),(20,1,'ticket.note.3','',NULL,'2016-01-04 15:04:48','2016-01-04 15:04:58'),(27,4,'ticket.client.5','',NULL,'2016-01-07 13:53:29','2016-01-08 08:38:12'),(29,4,'ticket.client.6','',NULL,'2016-01-07 13:53:55',NULL),(31,3,'ticket.note.5','',NULL,'2016-01-07 13:56:32','2016-01-07 13:58:21'),(32,3,'ticket.response.5','',NULL,'2016-01-07 13:57:42','2016-01-07 13:58:21'),(33,1,'ticket.response.6','',NULL,'2016-01-08 13:15:29',NULL),(34,1,'ticket.note.6','',NULL,'2016-01-08 13:15:29',NULL),(35,1,'page.3','<div> <h1> <span style=\"font-size:medium\"> Support hors Ligne</span> </h1> Merci d\'utiliser notre outil de support.<br /> Notre helpdesk est actuellement hors ligne . Veuillez réessayer ultérieurement.<br /> </div>',NULL,'2016-01-08 14:31:52','2016-01-08 14:32:02'),(36,1,'email.diag','',NULL,'2016-01-08 14:45:57','2016-01-08 14:46:07'),(37,1,'ticket